import React from "react";
import { Button, Checkbox, FormControl, FormControlLabel, Input, InputAdornment, Paper, TextField, Typography } from "@mui/material"
import style from './SolicitaServico.module.scss';
import { Box } from "@mui/system";
import moment from 'moment';

export const SolicitaServico = ({ user, veiculo, setCadastroServico }) => {

    console.log(user)
    console.log(veiculo)

    const [despachante, setDespachante] = React.useState({
        nome: user.nome,
        rg: user.rg,
        cpf: user.cpf,
        crdd: user.nCrddrs,
        logradouro: user.logradouro,
        cidade: user.cidade,
    })
    const [servico, setServico] = React.useState({
        inclusao_ou_alteracao_registro_financeiro: false,
        alteracao_info_proprietario: false,
        alteracao_info_veiculo: false,
        alteracao_restricao_financeira: false,
        alteracao_endereco_entrega_CRL_CRLV: false,
        correcao_restricao: false,
        emissao_DCPPO: false,
        fornecimento_placa_experiencia_fabricante: false,
        inclusao_restricao_financeira: false,
        liberacao_averbacao_execucao: false,
        liberacao_restricao_financeira: false,
        licenca_especial_transito: false,
        mudanca_placa_unica: false,
        primeiro_emplamaneto: false,
        renovacao_placa_experiencia_fabricante: false,
        reserva_placa: false,
        restricao_transferencia: false,
        solicitacao_autorizacao_alteracao_caracteristicas: false,
        solicitacao_autorizacao_regravacao_chassi: false,
        solicitacao_autorizacao_transporte_escolar: false,
    })
    const [ novoEndereco, setNovoEndereco ] = React.useState({
        novo_endereco: "",
        numero: "",
        bairro: "",
        cidade: "",
        uf: "",
        cep: ""
    })

    const [validaFin, setValidaFin] = React.useState(false)
    const restricaoFinanceira = (e) => {
        setValidaFin(!validaFin)
    }

    const [validaSeg, setValidaSeg] = React.useState({
        CRLV: false,
        CRV_CRLV: false
    })

    const segundaVia1 = (e) => {
        setValidaSeg(a => ({ ...a, CRLV: e.target.checked, CRV_CRLV: false }))
    }
    const segundaVia2 = (e) => {
        setValidaSeg(a => ({ ...a, CRV_CRLV: e.target.checked, CRLV: false }))
    }

    const [altEnd, setAltEnd] = React.useState(false)

    const [altInfProp, setAltInfProp] = React.useState(false)
    const [altInfVeic, setAltInfVeic] = React.useState(false)
    const [altRestFin, setAltRestFin] = React.useState(false)
    const [altEndEntC, setAltEndEntC] = React.useState(false)


    const [data, setData] = React.useState();
    const [d, setD] = React.useState(moment().format('YYYY-MM-DD'))

    console.log('oooo::', data, d)

    console.log(moment(d).format('DD/MM/YYYY'))//Verifica aqui!!

    const Enviar = (e) => {
        e.preventDefault();
        console.log()
    }

    return (
        <>

            <form className={style.opcoes} onSubmit={Enviar}>
                <Box sx={{ width: '100%' }}>
                    <Paper sx={{ p: 2 }}>
                        <Typography variant="h5" align="center">GRT - GUIA DE RESPONSABILIDADE TÉCNICA</Typography>
                        <div className={style.boxlinha}>
                            <h2>Despachante / Auxiliar(DAV):</h2>
                            <FormControl sx={{ width: '40%' }} variant="standard" >
                                <Input value={despachante.nome}
                                    startAdornment={<InputAdornment position="start"></InputAdornment>}
                                    onChange={(e) => setDespachante(a => ({ ...a, nome: e.target.value }))}
                                />
                            </FormControl>
                            <h2>RG:</h2>
                            <FormControl sx={{ width: '20%' }} variant="standard" >
                                <Input value={despachante.rg}
                                    startAdornment={<InputAdornment position="start"></InputAdornment>}
                                    onChange={(e) => setDespachante(a => ({ ...a, rg: e.target.value }))}
                                />
                            </FormControl>
                            <h2>CPF:</h2>
                            <FormControl sx={{ width: '20%' }} variant="standard" >
                                <Input value={despachante.cpf}
                                    startAdornment={<InputAdornment position="start"></InputAdornment>}
                                    onChange={(e) => setDespachante(a => ({ ...a, cpf: e.target.value }))}
                                />
                            </FormControl>
                        </div>
                        <div className={style.boxlinha}>
                            <h2>CRDD Nº:</h2>
                            <FormControl sx={{ width: '13%' }} variant="standard" >
                                <Input value={despachante.crdd}
                                    startAdornment={<InputAdornment position="start"></InputAdornment>}
                                    onChange={(e) => setDespachante(a => ({ ...a, crdd: e.target.value }))}
                                />
                            </FormControl>
                            <h2>,Endereço:</h2>
                            <FormControl sx={{ width: '40%' }} variant="standard" >
                                <Input value={despachante.logradouro}
                                    startAdornment={<InputAdornment position="start"></InputAdornment>}
                                    onChange={(e) => setDespachante(a => ({ ...a, logradouro: e.target.value }))}
                                />
                            </FormControl>
                            <h2>Cidade:</h2>
                            <FormControl sx={{ width: '32%' }} variant="standard" >
                                <Input value={despachante.cidade}
                                    startAdornment={<InputAdornment position="start"></InputAdornment>}
                                    onChange={(e) => setDespachante(a => ({ ...a, cidade: e.target.value }))}
                                />
                            </FormControl>
                        </div>
                        <h2 className={style.linhaservico}>Requer ao DETRAN/RS a realização dos seguintes serviços</h2>
                        <div className={style.container}>
                            <div className={style.boxleft}>
                                <h2>Haverá inclusão ou alteração de registro financeiro?</h2>
                                <div className={style.unicoassim}>
                                    <div><FormControlLabel control={
                                        <Checkbox
                                            checked={servico.inclusao_ou_alteracao_registro_financeiro}
                                            onChange={(e) => setServico(a => ({ ...a, inclusao_ou_alteracao_registro_financeiro: true }))} />}
                                            label='Sim' 
                                        />
                                    </div>
                                    <div><FormControlLabel control={
                                        <Checkbox
                                            checked={!servico.inclusao_ou_alteracao_registro_financeiro}
                                            onChange={(e) => setServico(a => ({  ...a, inclusao_ou_alteracao_registro_financeiro: false }))} />}
                                            label="Não" 
                                        />
                                    </div>
                                </div>
                                <div className={style.boxlinha}>
                                    <h2>Agente Financeiro</h2>
                                    <TextField fullWidth size="small" variant="standard" />
                                </div>
                                <TextField fullWidth size="small" variant="standard" disabled />
                                <div className={style.boxlinha}>
                                    <FormControlLabel control={<Checkbox checked={validaSeg.CRLV} onChange={segundaVia1} />} label='2ª Via CRLV' />
                                    <FormControlLabel control={<Checkbox checked={validaSeg.CRV_CRLV} onChange={segundaVia2} />} label='2ª Via CRV/CRLV' />
                                </div>
                                <div className={style.boxlinha}>
                                    <h2>Motivo:</h2>
                                    <TextField fullWidth size='small' variant="standard" />
                                </div>
                                <FormControlLabel control={<Checkbox checked={altEnd} onChange={(e) => setAltEnd(e.target.checked)} />} label='Alteração do endereço residencial' />
                                <div className={style.boxlinha}>
                                    <h2>Novo endereço:</h2>
                                    <TextField fullWidth size="small" variant='standard' />
                                </div>
                                <div className={style.boxlinha}>
                                    <h2>CEP:</h2>
                                    <TextField fullWidth size="small" variant='standard' />
                                </div>
                                <FormControlLabel 
                                    sx={{ height: 22 }}
                                    control={
                                        <Checkbox 
                                            size='small'
                                            checked={servico.alteracao_info_proprietario}
                                            onChange={(e) => setServico(a => ({...a, alteracao_info_proprietario: e.target.checked}))}
                                        />}
                                    label='Alteração de Informações do Proprietário' />
                                <FormControlLabel 
                                    sx={{ height: 22 }}
                                    control={
                                        <Checkbox 
                                            size='small'
                                            checked={servico.alteracao_info_veiculo}
                                            onChange={(e) => setServico(a => ({...a, alteracao_info_veiculo: e.target.checked}))}
                                        />}
                                    label='Alteração de Informações do Veículo' />
                                <FormControlLabel 
                                    sx={{ height: 22 }}
                                    control={
                                        <Checkbox 
                                            size='small'
                                            checked={servico.alteracao_restricao_financeira}
                                            onChange={(e) => setServico(a => ({...a, alteracao_restricao_financeira: e.target.checked}))}
                                        />}
                                    label='Alteração de Restrição Financeira' />
                                <FormControlLabel 
                                    sx={{ height: 22 }}
                                    control={
                                        <Checkbox 
                                            size='small'
                                            checked={servico.alteracao_endereco_entrega_CRL_CRLV}
                                            onChange={(e) => setServico(a => ({...a, alteracao_endereco_entrega_CRL_CRLV: e.target.checked}))}
                                        />}
                                    label='Alteração de Endereço de entrega do CRV/CRLV' />
                            </div>
                            <div className={style.boxrigth}>
                                <FormControlLabel 
                                    sx={{ height: 22, whiteSpace: "nowrap" }}
                                    control={
                                        <Checkbox 
                                            size='small' 
                                            checked={servico.correcao_restricao} 
                                            onChange={(e) => setServico(a => ({...a,correcao_restricao: e.target.checked}))} 
                                        />}
                                    label='Correção de Restrições' 
                                />
                                <FormControlLabel 
                                    sx={{ height: 22, whiteSpace: "nowrap" }}
                                    control={
                                        <Checkbox 
                                            size='small' 
                                            checked={servico.emissao_DCPPO} 
                                            onChange={(e) => setServico(a => ({...a,emissao_DCPPO: e.target.checked}))} 
                                        />}
                                    label='Emissão de DCPPO' 
                                />
                                <FormControlLabel 
                                    sx={{ height: 22, whiteSpace: "nowrap" }}
                                    control={
                                        <Checkbox 
                                            size='small' 
                                            checked={servico.fornecimento_placa_experiencia_fabricante} 
                                            onChange={(e) => setServico(a => ({...a,fornecimento_placa_experiencia_fabricante: e.target.checked}))} 
                                        />}
                                    label='Fornecimento de Placa de Experiência ou de Fabricante' 
                                />
                                <FormControlLabel 
                                    sx={{ height: 22, whiteSpace: "nowrap" }}
                                    control={
                                        <Checkbox 
                                            size='small' 
                                            checked={servico.inclusao_restricao_financeira} 
                                            onChange={(e) => setServico(a => ({...a,inclusao_restricao_financeira: e.target.checked}))} 
                                        />}
                                    label='Inclusão de Restrição Financeira' 
                                />
                                <FormControlLabel 
                                    sx={{ height: 22, whiteSpace: "nowrap" }}
                                    control={
                                        <Checkbox 
                                            size='small' 
                                            checked={servico.liberacao_averbacao_execucao} 
                                            onChange={(e) => setServico(a => ({...a,liberacao_averbacao_execucao: e.target.checked}))} 
                                        />}
                                    label='Liberação de Averbação de Execução' 
                                />
                                <FormControlLabel 
                                    sx={{ height: 22, whiteSpace: "nowrap" }}
                                    control={
                                        <Checkbox 
                                            size='small' 
                                            checked={servico.liberacao_restricao_financeira} 
                                            onChange={(e) => setServico(a => ({...a,liberacao_restricao_financeira: e.target.checked}))} 
                                        />}
                                    label='Liberação de Restrição Financeira' 
                                />
                                <FormControlLabel 
                                    sx={{ height: 22, whiteSpace: "nowrap" }}
                                    control={
                                        <Checkbox 
                                            size='small' 
                                            checked={servico.licenca_especial_transito} 
                                            onChange={(e) => setServico(a => ({...a,licenca_especial_transito: e.target.checked}))} 
                                        />}
                                    label='Licença especial de Trânsito' 
                                />
                                <FormControlLabel 
                                    sx={{ height: 22, whiteSpace: "nowrap" }}
                                    control={
                                        <Checkbox 
                                            size='small' 
                                            checked={servico.mudanca_placa_unica} 
                                            onChange={(e) => setServico(a => ({...a,mudanca_placa_unica: e.target.checked}))} 
                                        />}
                                    label='Mudança Para Placa Única' 
                                />
                                <FormControlLabel 
                                    sx={{ height: 22, whiteSpace: "nowrap" }}
                                    control={
                                        <Checkbox 
                                            size='small' 
                                            checked={servico.primeiro_emplamaneto} 
                                            onChange={(e) => setServico(a => ({...a,primeiro_emplamaneto: e.target.checked}))} 
                                        />}
                                    label='Primeiro Emplacamento' 
                                />
                                <FormControlLabel 
                                    sx={{ height: 22, whiteSpace: "nowrap" }}
                                    control={
                                        <Checkbox 
                                            size='small' 
                                            checked={servico.renovacao_placa_experiencia_fabricante} 
                                            onChange={(e) => setServico(a => ({...a,renovacao_placa_experiencia_fabricante: e.target.checked}))} 
                                        />}
                                    label='Renovação de Placa de Experiência ou de Fabricante' 
                                />
                                <FormControlLabel 
                                    sx={{ height: 22, whiteSpace: "nowrap" }}
                                    control={
                                        <Checkbox 
                                            size='small' 
                                            checked={servico.reserva_placa} 
                                            onChange={(e) => setServico(a => ({...a,reserva_placa: e.target.checked}))} 
                                        />}
                                    label='Reserva de Placa' 
                                />
                                <FormControlLabel 
                                    sx={{ height: 22, whiteSpace: "nowrap" }}
                                    control={
                                        <Checkbox 
                                            size='small' 
                                            checked={servico.restricao_transferencia} 
                                            onChange={(e) => setServico(a => ({...a,restricao_transferencia: e.target.checked}))} 
                                        />}
                                    label='Restrição por Transferência' 
                                />
                                <FormControlLabel 
                                    sx={{ height: 22, whiteSpace: "nowrap" }}
                                    control={
                                        <Checkbox 
                                            size='small' 
                                            checked={servico.solicitacao_autorizacao_alteracao_caracteristicas} 
                                            onChange={(e) => setServico(a => ({...a,solicitacao_autorizacao_alteracao_caracteristicas: e.target.checked}))} 
                                        />}
                                    label='Solicitação de Autorização para Alteração de Características' 
                                />
                                <FormControlLabel 
                                    sx={{ height: 22, whiteSpace: "nowrap" }}
                                    control={
                                        <Checkbox 
                                            size='small' 
                                            checked={servico.solicitacao_autorizacao_regravacao_chassi} 
                                            onChange={(e) => setServico(a => ({...a,solicitacao_autorizacao_regravacao_chassi: e.target.checked}))} 
                                        />}
                                    label='Solicitação de Autorização para Regravação de Nº de Chassi' 
                                />
                                <FormControlLabel 
                                    sx={{ height: 22, whiteSpace: "nowrap" }}
                                    control={
                                        <Checkbox 
                                            size='small' 
                                            checked={servico.solicitacao_autorizacao_transporte_escolar} 
                                            onChange={(e) => setServico(a => ({...a,solicitacao_autorizacao_transporte_escolar: e.target.checked}))} 
                                        />}
                                    label='Solicitação de Autorização para Transporte Escolar' 
                                />
                            </div>
                        </div>
                        <div className={style.boxlinha}>
                            <h2>Novo Endereço: Rua/Av.:</h2>
                            <FormControl disabled={!altEndEntC} fullWidth variant="standard" ><Input value={novoEndereco.novo_endereco} startAdornment={<InputAdornment position="start"></InputAdornment>} /></FormControl>
                            <h2>Nº:</h2>
                            <TextField size="small" variant='standard' disabled={!altEndEntC} />
                            <FormControl disabled={!altEndEntC} fullWidth variant="standard" ><Input value={novoEndereco.numero} startAdornment={<InputAdornment position="start"></InputAdornment>} /></FormControl>
                        </div>
                        <div className={style.boxlinha}>
                            <h2>Bairro:</h2>
                            <TextField fullWidth size="small" variant='standard' disabled={!altEndEntC} />
                            <FormControl disabled={!altEndEntC} fullWidth variant="standard" ><Input value={novoEndereco.bairro} startAdornment={<InputAdornment position="start"></InputAdornment>} /></FormControl>
                            <h2>Cidade:</h2>
                            <TextField fullWidth size="small" variant='standard' disabled={!altEndEntC} />
                            <FormControl disabled={!altEndEntC} fullWidth variant="standard" ><Input value={novoEndereco.cidade} startAdornment={<InputAdornment position="start"></InputAdornment>} /></FormControl>
                            <h2>UF:</h2>
                            <TextField sx={{ minWidth: '60px' }} size="small" variant='standard' disabled={!altEndEntC} />
                            <FormControl disabled={!altEndEntC} fullWidth variant="standard" ><Input value={novoEndereco.uf} startAdornment={<InputAdornment position="start"></InputAdornment>} /></FormControl>
                            <h2>CEP:</h2>
                            <TextField sx={{ minWidth: '150px' }} size="small" variant='standard' disabled={!altEndEntC} />
                            <FormControl disabled={!altEndEntC} fullWidth variant="standard" ><Input value={novoEndereco.cep} startAdornment={<InputAdornment position="start"></InputAdornment>} /></FormControl>
                        </div>
                        <h2 className={style.linhaservico}> </h2>
                        <div className={style.container}>
                            <div className={style.boxrigth}>
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altInfProp} onChange={(e) => setAltInfProp(e.target.checked)} />} label='Averbação de Execução' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altInfVeic} onChange={(e) => setAltInfVeic(e.target.checked)} />} label='Baixa de Placa de Experiência ou de Fabricante' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altRestFin} onChange={(e) => setAltRestFin(e.target.checked)} />} label='Baixa para outra UF' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altEndEntC} onChange={(e) => setAltEndEntC(e.target.checked)} />} label='Baixa de Veículo' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altInfProp} onChange={(e) => setAltInfProp(e.target.checked)} />} label='Cancelamento de Processo' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altInfVeic} onChange={(e) => setAltInfVeic(e.target.checked)} />} label='Colocação em Lacre de Placa' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altRestFin} onChange={(e) => setAltRestFin(e.target.checked)} />} label='Comunicação de Venda' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altEndEntC} onChange={(e) => setAltEndEntC(e.target.checked)} />} label='Correção das Observações do CRV/CRLV' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altInfProp} onChange={(e) => setAltInfProp(e.target.checked)} />} label='Correção de Chassi' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altInfVeic} onChange={(e) => setAltInfVeic(e.target.checked)} />} label='Correção de Informações do Proprietário' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altRestFin} onChange={(e) => setAltRestFin(e.target.checked)} />} label='Correção de Informações do Veículo' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altEndEntC} onChange={(e) => setAltEndEntC(e.target.checked)} />} label='Correção de Município' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altInfProp} onChange={(e) => setAltInfProp(e.target.checked)} />} label='Autorizo o DETRAN/RS a enviar por email ou telefone' />
                                <h2 className={style.nocheck}>celular as informações do meu interesse junto a este órgão.</h2>
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altInfVeic} onChange={(e) => setAltInfVeic(e.target.checked)} />} label='Não autorizo o recebimento de informações do DETRAN/RS' />
                                <h2 className={style.nocheck}>e estou ciente de que será minha responsabilidade obter as</h2>
                                <h2 className={style.nocheck}>informações relevantes ao meu veículo</h2>
                            </div>
                            <div className={style.boxrigth}>
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altInfProp} onChange={(e) => setAltInfProp(e.target.checked)} />} label='Solicitação de Certidão' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altInfVeic} onChange={(e) => setAltInfVeic(e.target.checked)} />} label='Solicitação de Cópia de Documentos' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altRestFin} onChange={(e) => setAltRestFin(e.target.checked)} />} label='Solicitação de Cópia de CRLV' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altEndEntC} onChange={(e) => setAltEndEntC(e.target.checked)} />} label='Solicitação de Vistoria' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altInfProp} onChange={(e) => setAltInfProp(e.target.checked)} />} label='Solicitação de DCPPO' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altInfVeic} onChange={(e) => setAltInfVeic(e.target.checked)} />} label='Transferência de Propriedade de Veículo de Outro Estado' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altRestFin} onChange={(e) => setAltRestFin(e.target.checked)} />} label='Transferência de Propriedade de Veículo do RS' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altEndEntC} onChange={(e) => setAltEndEntC(e.target.checked)} />} label='Troca de Município Veículo de Outro Estado' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altEndEntC} onChange={(e) => setAltEndEntC(e.target.checked)} />} label='Troca de Município Veículo do RS' />
                                <FormControlLabel sx={{ height: 22, whiteSpace: "nowrap" }} control={<Checkbox size='small' checked={altInfProp} onChange={(e) => setAltInfProp(e.target.checked)} />} label='Outros:' />
                                <TextField sx={{ minWidth: '150px' }} size="small" variant='standard' />
                                <h2 className={style.linhaservico}> </h2>
                                <div className={style.boxlinha}>
                                    <h2>Relativo ao Veículo:</h2>
                                    <TextField fullWidth size="small" variant='standard' />
                                </div>
                                <div className={style.boxlinha}>
                                    <h2>Chassi/Placa:</h2>
                                    <TextField fullWidth size="small" variant='standard' />
                                </div>
                            </div>
                        </div>
                        <div className={style.centrador}>
                            <input className={style.data} type='date' value={d} onChange={e => setD(e.target.value)} />
                            <div className={style.boxlinha}>
                                <Button sx={{ pt: 5 }} type='submit' >Salvar</Button>
                            </div>
                        </div>
                    </Paper>
                </Box>
            </form>
        </>
    )
}
